import React ,{Component} from ' react';
import { Home } from './Home';


class Main extends Component {
    render(){
        const HomePage = () => {
            return (
                <Home />
                    )
        }
        return(
            <div>
                <HomePage></HomePage>
                </div>
                )
    }

}


export default Main;
